import React from "react";
import "./UserList.css";

const UserList = (props) => {
  const UserItemes = props.list.map((userItem) => {
    console.log(userItem);
  });
  return (
    <div className="list-controler">
      {props.list[0].userName + props.list[0].age}
    </div>
  );
};

export default UserList;
